import * as THREE from 'three';
const dataSrc = "data:image/png;base64,";

export default () => {
    const CallMainStage = () => {
        const MainStage = () => {
            const Window = window,
                windowWidth = Window.innerWidth,
                windowHeight = Window.innerHeight,
                rendererCanvasID = "particle-effect-canvas";

            let renderer,
                scene,
                camera,
                particles,
                imagedata,
                clock = new THREE.Clock(),
                mouseX = 0,
                mouseY = 0,
                isMouseDown = true,
                lastMousePos = { x: 0, y: 0 },
                windowHalfX = windowWidth / 2,
                windowHalfY = windowHeight / 2;

            //particle rotation
            let particleRotation;
            let centerVector = new THREE.Vector3(0, 0, 0);
            let previousTime = 0;

            const init = () => {
                THREE.ImageUtils.crossOrigin = "";
                renderer = new THREE.WebGLRenderer({
                    canvas: document.getElementById(rendererCanvasID), //canvas
                    alpha: true,
                    antialias: true
                });
                renderer.setSize(windowWidth, windowHeight);
                scene = new THREE.Scene();
                camera = new THREE.PerspectiveCamera(60, windowWidth / windowHeight, 1, 10000);
                camera.position.set(0, 0, 600);
                camera.lookAt(centerVector);
                scene.add(camera);
                let loader = new THREE.TextureLoader();
                loader.load(dataSrc, (texture) => {
                    imagedata = getImageData(texture.image);
                    let geometry = new THREE.Geometry();
                    let material = new THREE.PointsMaterial({
                        size: 1,
                        color: 0x81ecec,
                        sizeAttenuation: false
                    });
                    for (let y = 0, y2 = imagedata.height; y < y2; y += 2) {
                        for (let x = 0, x2 = imagedata.width; x < x2; x += 2) {
                            if (imagedata.data[x * 4 + y * 4 * imagedata.width + 3] > 128) {
                                let vertex = new THREE.Vector3();
                                vertex.x = Math.random() * 1000 - 500;
                                vertex.y = Math.random() * 1000 - 500;
                                vertex.z = -Math.random() * 500;
                                vertex.destination = {
                                    x: x - imagedata.width / 2,
                                    y: -y + imagedata.height / 2,
                                    z: 0
                                };
                                vertex.speed = Math.random() / 200 + 0.03;
                                geometry.vertices.push(vertex);
                            }
                        }
                    }
                    particles = new THREE.Points(geometry, material);
                    scene.add(particles);
                },
                    undefined,
                    (err) => {
                        console.error(`An error happened: ${err}`);
                    }
                );
                particleRotation = new THREE.Object3D();
                scene.add(particleRotation);
                let geometryPR = new THREE.TetrahedronGeometry(1, 0),
                    materialPR = new THREE.MeshPhongMaterial({
                        color: "#81ecec",
                        flatShading: THREE.FlatShading
                    });

                for (let i = 0; i < 900; i++) {
                    let mesh = new THREE.Mesh(geometryPR, materialPR);
                    mesh.position.set(Math.random() - 0.5, Math.random() - 0.5, Math.random() - 0.5).normalize();
                    mesh.position.multiplyScalar(90 + Math.random() * 700);
                    mesh.rotation.set(Math.random() * 2, Math.random() * 2, Math.random() * 2);
                    particleRotation.add(mesh);
                }
                let ambientLight = new THREE.AmbientLight('#999999');
                scene.add(ambientLight);
                let lights = [];
                lights[0] = new THREE.DirectionalLight('#ffffff', 1);
                lights[0].position.set(1, 0, 0);
                lights[1] = new THREE.DirectionalLight('#11e8bb', 1);
                lights[1].position.set(0.75, 1, 0.5);
                lights[2] = new THREE.DirectionalLight('#12efff', 1);
                lights[2].position.set(-0.75, -1, 0.5);
                scene.add(lights[0]);
                scene.add(lights[1]);
                scene.add(lights[2]);
                document.addEventListener("mousemove", onDocumentMouseMove, false);
                document.addEventListener("touchstart", onDocumentTouchStart, false);
                document.addEventListener("touchmove", onDocumentTouchMove, false);
                document.addEventListener("mousedown", onDocumentMouseDown, false);
                document.addEventListener("mouseup", onDocumentMouseUp, false);
                Window.addEventListener("resize", onWindowResize, false);
            };

            const render = () => {
                requestAnimationFrame(render);
                let delta = clock.getDelta(),
                    thickness = 40;
                if (typeof particles !== typeof undefined) {
                    for (let i = 0, j = particles.geometry.vertices.length; i < j; i++) {
                        let particle = particles.geometry.vertices[i];
                        particle.x += (particle.destination.x - particle.x) * particle.speed;
                        particle.y += (particle.destination.y - particle.y) * particle.speed;
                        particle.z += (particle.destination.z - particle.z) * particle.speed;
                    }
                    if (delta - previousTime > thickness) {
                        let index = Math.floor(Math.random() * particles.geometry.vertices.length);
                        let particle1 = particles.geometry.vertices[index];
                        let particle2 = particles.geometry.vertices[particles.geometry.vertices.length - index];
                        Window.TweenMax.to(particle1, Math.random() * 2 + 1, {
                            x: particle2.x,
                            y: particle2.y,
                            ease: Window.Power2.easeInOut
                        });
                        Window.TweenMax.to(particle2, Math.random() * 2 + 1, {
                            x: particle1.x,
                            y: particle1.y,
                            ease: Window.Power2.easeInOut
                        });
                        previousTime = delta;
                    }
                    particles.geometry.verticesNeedUpdate = true;
                }
                if (!isMouseDown) {
                    camera.position.x += (0 - camera.position.x) * 0.06;
                    camera.position.y += (0 - camera.position.y) * 0.06;
                }
                camera.position.x += (mouseX - camera.position.x) * 0.09;
                camera.position.y += (-mouseY - camera.position.y) * 0.09;
                camera.lookAt(centerVector);
                particleRotation.rotation.x += 0.0;
                particleRotation.rotation.y -= 0.004;
                renderer.render(scene, camera);
            };

            const onWindowResize = () => {
                camera.aspect = Window.innerWidth / Window.innerHeight;
                camera.updateProjectionMatrix();
                renderer.setSize(Window.innerWidth, Window.innerHeight);
            };

            const onDocumentMouseMove = (event) => {
                mouseX = event.clientX - windowHalfX;
                mouseY = event.clientY - windowHalfY;
                if (isMouseDown) {
                    camera.position.x += (event.clientX - lastMousePos.x) / 100;
                    camera.position.y -= (event.clientY - lastMousePos.y) / 100;
                    camera.lookAt(centerVector);
                    lastMousePos = { x: event.clientX, y: event.clientY };
                }
            };

            const onDocumentTouchStart = (event) => {
                if (event.touches.length === 1) {
                    event.preventDefault();
                    mouseX = event.touches[0].pageX - windowHalfX;
                    mouseY = event.touches[0].pageY - windowHalfY;
                }
            };

            const onDocumentTouchMove = (event) => {
                if (event.touches.length === 1) {
                    event.preventDefault();
                    mouseX = event.touches[0].pageX - windowHalfX;
                    mouseY = event.touches[0].pageY - windowHalfY;
                }
            };

            const onDocumentMouseUp = () => {
                isMouseDown = false;
            };

            const onDocumentMouseDown = (event) => {
                isMouseDown = true;
                lastMousePos = { x: event.clientX, y: event.clientY };
            };

            const getImageData = (image) => {
                let canvas = document.createElement("canvas");
                canvas.width = image.width;
                canvas.height = image.height;
                let ctx = canvas.getContext("2d");
                ctx.drawImage(image, 0, 0);
                return ctx.getImageData(0, 0, image.width, image.height);
            };
            return {
                init: () => { init() },
                render: () => { render() },
                getScene: () => {
                    return scene;
                },
                getCamera: () => {
                    return camera;
                }
            };
        };
        const Main = MainStage();
        Main.init();
        Main.render();
    };
    CallMainStage();
};
